text:
ich habe mein gewicht halbiert, allerdings in einem deutlich längeren zeitraum (2,5 jahre). ich gehe allerdings auch seit längerem zur psychotherapie, eben weil mein verhältnis zu essen nicht gesund normal ist. bei mir war ist das problem, dass ich eine zeit lang quasi sklavisch unter x kcal bleibe, um dann für mehrere tage 4.000kcal und mehr zu essen (als 1,63m große frau ohne nennenswerte sportliche aktivität als gegenpol). durch die therapie haben sich die essanfälle deutlich verringert und ich bin inzwischen (zugegebenermaßen wenn es mir psychisch gut geht) in der lage, nur moderat über die x kcal zu kommen - statt 1.500 bspw. 2.000kcal. ohne, dass ich dabei das gefühl habe, dass es gleich ausartet und auch größtenteils ohne dieses "schlechte gewissen", dass ich über der grenze bin. (ein besserer begriff als "schlechtes gewissen" fällt mir nicht ein, aber eigentlich ist es zu schwach für das, was ich dabei empfunden habe bzw. jetzt auch noch teilweise empfinde.)
x200b;
ich rate dir dringend zur therapie. ich weiß natürlich nicht, wie groß  alt du bist, welchen job du ausübst und welches geschlecht du hast. aber 1.500kcal und dann 3-5x pro woche krafttraining kann nicht funktionieren. und es ist auch nicht zielführend. du verbrennst dabei zwar kalorien, baust aber kaum muskeln auf bzw. baust vermutlich sogar welche ab, weil dein körper sie nicht versorgen kann.
x200b;
du weißt selbst, dass dein aktueller lebensstil nicht nachhaltig oder gesund ist. weder für deinen körper noch für deine psyche. also such dir bitte professionelle hilfe. normalgewichtig sein ist möglich, auch für jemanden mit solch einer vergangenheit. es mag für uns nicht so einfach sein wie für andere, aber es geht und aus meiner sicht ist es ein erstrebenswertes ziel. und wenn das krafttraining dann tatsächlich in einem plus an muskelmasse und stärke resultiert, weil der körper mit der notwendigen energie und den richtigen nährstoffen versorgt wird, ist das ein super gefühl. meinst du vielleicht "scham"?

