j'ai vraiment le sentiment que c'est surtout l'anime qui est populaire.
nbsp;
l'article dit d'ailleurs:
cet anime est très différent du manga.
nbsp;
ne connaissant ni le manga ni l'anime, le manga vaut-il le coup ? j'aurais tendance à dire que l'anime est supérieur, notamment par sa bande son franchement fantastique et l'ajout de quelques scènes bienvenues dans les saisons (parties) les plus récentes. cela dit, je crois pas que ce soit dispo en français, et je trouve le doublage anglais un peu médiocre, donc si tu parles jap ou que t'aimes pas les sous titres le manga serait peut-être mieux pour toi

